require 'benchmark'

# @param {String} s
# @param {Integer} x
# @param {Integer} y
# @return {Integer}
def maximum_gain(s, x, y)
  gain = 0
  chrs = s.chars
  ch11, ch12, score1, ch21, ch22, score2 = x > y ? ['a', 'b', x, 'b', 'a', y] : ['b', 'a', y, 'a', 'b', x]
  iter_count = 0
  loop do
    chrs, count = check_gain(chrs, ch11, ch12)
    gain += score1 * count
    iter_count = count.zero? ? iter_count + 1 : 0
    break if iter_count > 1

    chrs, count = check_gain(chrs, ch21, ch22)
    gain += score2 * count
    iter_count = count.zero? ? iter_count + 1 : 0
    break if iter_count > 1
  end
  gain
end

def check_gain(chrs, ch1, ch2)
  stack = []
  chrs.each do |chr|
    if chr == ch2
      if stack.last == ch1
        stack.pop
      else
        stack.push chr
      end
    else
      stack.push chr
    end
  end
  [stack, (chrs.size - stack.size) / 2]
end

s = 'cdbcbbaaabab'
x = 4
y = 5
puts maximum_gain(s, x, y) # 19
s = 'aabbaaxybbaabb'
x = 5
y = 4
puts maximum_gain(s, x, y) # 20
s = ''
x = 9150
y = 6050
bench = Benchmark.measure {
